import React from "react"
import img1 from "../img/can-5.png"
import img2 from "../img/gb.svg"
import FreelancerData from "../data/FreelancerData";

const FreelancerInnerHeader =({name, designation, location, hourlyRate,verified }) => {
    return (
        <>
            {/*<section className="inner-header-page">*/}
            {/*    <div className="container">*/}

            {/*        <div className="col-md-8">*/}
            {/*            <div className="left-side-container">*/}
            {/*                <div className="freelance-image"><a href="#"><img*/}
            {/*                    src={img1} className="img-responsive img-circle" alt="" /></a></div>*/}
            {/*                <div className="header-details">*/}
            {/*                    <h4>{FreelancerData[0].name} <span className="pull-right">{FreelancerData[0].hourlyRate}</span></h4>*/}
            {/*                    <p>{FreelancerData[0].designation}</p>*/}
            {/*                    <ul>*/}
            {/*                        <li><a href="#"><i className="fa fa-building"></i> {FreelancerData[0].location}</a></li>*/}
            {/*                        <li>*/}
            {/*                            <div className="star-rating" data-rating="4.2">*/}
            {/*                                <span className="fa fa-star fill"></span>*/}
            {/*                                <span className="fa fa-star fill"></span>*/}
            {/*                                <span className="fa fa-star fill"></span>*/}
            {/*                                <span className="fa fa-star fill"></span>*/}
            {/*                                <span className="fa fa-star-half fill"></span>*/}
            {/*                            </div>*/}
            {/*                        </li>*/}
            {/*                        <li><img className="flag" src={img2} alt=""/> United Kingdom</li>*/}
            {/*                        <li>*/}
            {/*                            <div className="verified-action">{FreelancerData[0].verified}</div>*/}
            {/*                        </li>*/}
            {/*                    </ul>*/}
            {/*                </div>*/}
            {/*            </div>*/}
            {/*        </div>*/}

            {/*        <div className="col-md-4 bl-1 br-gary">*/}
            {/*            <div className="right-side-detail">*/}
            {/*                <ul>*/}
            {/*                    <li><span className="detail-info">Availability</span>Full Time<span*/}
            {/*                        className="available-status">Available</span></li>*/}
            {/*                    <li><span className="detail-info">Location</span>Australia</li>*/}
            {/*                    <li><span className="detail-info">Experience</span>5 Year</li>*/}
            {/*                    <li><span className="detail-info">Age</span>27 Year</li>*/}
            {/*                </ul>*/}
            {/*                <ul className="social-info">*/}
            {/*                    <li><a href="#"><i className="fa fa-facebook"></i></a></li>*/}
            {/*                    <li><a href="#"><i className="fa fa-twitter"></i></a></li>*/}
            {/*                    <li><a href="#"><i className="fa fa-linkedin"></i></a></li>*/}
            {/*                    <li><a href="#"><i className="fa fa-instagram"></i></a></li>*/}
            {/*                    <li><a href="#"><i className="fa fa-pinterest"></i></a></li>*/}
            {/*                </ul>*/}
            {/*            </div>*/}
            {/*        </div>*/}

            {/*    </div>*/}
            {/*</section>*/}
            {/*<div className="clearfix"></div>*/}
            <section className="inner-header-page">
                <div className="container">

                    <div className="col-md-8">
                        <div className="left-side-container">
                            {/*<div className="freelance-image"><a href="#"><img*/}
                            {/*    src="assets/img/can-5.jpg" className="img-responsive img-circle" alt=""/></a></div>*/}
                            <div className="header-details">
                                <h4>Janelia Fragrintio<span className="pull-right">$44/hr</span></h4>
                                <p>Full Stack PHP Developer</p>
                                <ul>
                                    <li><a href="#"><i className="fa fa-building"></i> Mack Star</a></li>
                                    <li>
                                        <div className="star-rating" data-rating="4.2">
                                            <span className="fa fa-star fill"></span>
                                            <span className="fa fa-star fill"></span>
                                            <span className="fa fa-star fill"></span>
                                            <span className="fa fa-star fill"></span>
                                            <span className="fa fa-star-half fill"></span>
                                        </div>
                                    </li>
                                    {/*<li><img className="flag" src="assets/img/gb.svg" alt=""> United Kingdom</li>*/}
                                    <li>
                                        <div className="verified-action">Verified</div>
                                    </li>
                                </ul>
                            </div>
                        </div>
                    </div>

                    <div className="col-md-4 bl-1 br-gary">
                        <div className="right-side-detail">
                            <ul>
                                <li><span className="detail-info">Availability</span>Full Time<span
                                    className="available-status">Available</span></li>
                                <li><span className="detail-info">Location</span>Australia</li>
                                <li><span className="detail-info">Experience</span>5 Year</li>
                                <li><span className="detail-info">Age</span>27 Year</li>
                            </ul>
                            <ul className="social-info">
                                <li><a href="#"><i className="fa fa-facebook"></i></a></li>
                                <li><a href="#"><i className="fa fa-twitter"></i></a></li>
                                <li><a href="#"><i className="fa fa-linkedin"></i></a></li>
                                <li><a href="#"><i className="fa fa-instagram"></i></a></li>
                                <li><a href="#"><i className="fa fa-pinterest"></i></a></li>
                            </ul>
                        </div>
                    </div>

                </div>
            </section>
            <div className="clearfix"></div>
        </>
    );
}
export default FreelancerInnerHeader;
